import styled, {css} from "styled-components";

export const Div = styled.div`
  ${props => props.container && css`
    width: 100vw;
    height: 100vh;
    background: #eee;
  `}

  ${props => props.info && css`
    width: 500px;
    height: 700px;
    background: #ffffff;
  `}
`;

export const StyledLogo = styled.img`

`;
